CREATE TABLE `tb_petprofile` (
  `Pet_ID` varchar(9) COLLATE utf8_bin NOT NULL,
  `Pet_Name` varchar(50) COLLATE utf8_bin NOT NULL,
  `Pet_Sex` enum('เมีย','ผู้') COLLATE utf8_bin DEFAULT NULL,
  `Pet_DOB` date NOT NULL,
  `Pet_Color` varchar(20) COLLATE utf8_bin NOT NULL,
  `PetType_ID` int(3) unsigned zerofill NOT NULL,
  `PetBreed_ID` int(3) unsigned zerofill NOT NULL,
  `Pet_Sterility` date DEFAULT NULL,
  `Owner_Name` varchar(120) COLLATE utf8_bin NOT NULL,
  `Owner_Addr` text COLLATE utf8_bin,
  `Owner_Tel` varchar(14) COLLATE utf8_bin NOT NULL,
  `Status` bit(1) NOT NULL,
  PRIMARY KEY (`Pet_ID`),
  KEY `fk_tb_petprofile_tb_pettype1_idx` (`PetType_ID`),
  KEY `fk_tb_petprofile_tb_petbreed1_idx` (`PetBreed_ID`),
  CONSTRAINT `fk_tb_petprofile_tb_petbreed1` FOREIGN KEY (`PetBreed_ID`) REFERENCES `tb_petbreed` (`PetBreed_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_tb_petprofile_tb_pettype1` FOREIGN KEY (`PetType_ID`) REFERENCES `tb_pettype` (`PetType_ID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
